LAHORE, Apr 5 (APP): Prime Minister Imran Khan on Tuesday held a meeting with Speaker Punjab Assembly Chaudhry Pervaiz Elahi and leader Pakistan Muslim League-Q Chaudhry Moonis Elahi.
The current political situation in the country was discussed during the meeting, the PM Office said.
